import React, { useState, useEffect } from "react";
import { debounce } from "lodash";

function Home() {
  {
    document.title = "Phone Phlinger | Home";
    document.getElementsByTagName("META")[3].content =
      "This is the meta for the home page!";
  }
  const [something, setSomething] = useState("xyz"); // just a quick reminder for state
  const sendRequest = () => {
    console.log(something);
    setSomething(JSON.stringify(something));
    console.log(something);
    fetch("http://127.0.0.1:5000/test", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ something: something }),
    })
      .then((response) => response.json())
      .then((data) => {
        debounce(() => setSomething(data[0]), 1000);
      });
  };

  return (
    <div>
      <h1>This is the Home Page!</h1>
      <button onClick={sendRequest}>click me to do something!</button>
      <h2>{something}</h2>
    </div>
  );
}

export default Home;
